window.bookSummaryJSON = "<p>After serving two years in a federal prison, Karen Hashimoto is out on parole and eager to put her criminal past behind her. No easy task, since she's also the former supervillain known as Crushette. A chance encounter leads to an unexpected opportunity, and she is recruited as the newest member of the city's premier team of superheroes: The Good Guys. </p> <p>Now Karen has new teammates, a new code name, and the daunting responsibility of trying to be the hero everyone thinks she can be. Becoming a champion for truth and justice is going to be rough, especially for the ex-girlfriend of the notorious Doctor Maniac. Karen will have to do everything in her powers to keep her past from ruining her future. It was so much simpler being the bad guy. </p>"; 
